import React from 'react'

const StateWise = () => {
    return (
        <>
            <section className="container-fluid">
                <div className="row">
                  <h2 className="text-danger text-center fw-bold pt-5">I COVID-19 Dashbord</h2>
                </div>

            </section>
        </>
    )
}

export default StateWise
